// components/Listagem.js
import React, { useState, useEffect } from 'react';
import { obterSimulacoes } from '../services/api';
import ListagemItemDetalhes from './ListagemItemDetalhes'; // Importe o novo componente

import './Listagem.css';

const Listagem = () => {
  const [simulacao, setSimulacao] = useState(null);

  useEffect(() => {
    const fetchSimulacoes = async () => {
      try {
        const data = await obterSimulacoes();
        console.log('Dados retornados pela API:', data);
        // Assumindo que você quer exibir apenas a primeira simulação, ajuste conforme necessário
        setSimulacao(data.length > 0 ? data[0] : null);
      } catch (error) {
        console.error('Erro ao buscar simulações:', error);
      }
    };

    fetchSimulacoes();
  }, []);

  return (
    <div>
      {simulacao && <ListagemItemDetalhes simulacao={simulacao} />}
    </div>
  );
};

export default Listagem;
